response.about:
что я люблю(Генадий Букин)
Я люблю когда титьками девки тресут;
Я люблю когда денюшки в руки плывут;
Я люблю когда детей дома нет;
Я люблю когда свободен туалет;
Я люблю когда жена уходит на всегда;
Я люблю когда в доме вкусная еда;
Я люблю пиво,шампанское,икру
И я ненавижу эту игру.
(если хочеш снами поржать от души заглени Гене в штаны)
